sys_variable_value.value:
(function execute(inputs, outputs) {

var gr1 = inputs.code;
 var inc_num = inputs.inc;
var code_split = gr1.split(",");
for(var i=0; i < code_split.length; i++){
//gs.info('Test1' +code_split[i]);
var gr = new GlideRecord("incident");
//gr.addQuery('number', inc_num);
//gr.addQuery('short_description', 'CONTAINS', code_split[i]);
gr.addEncodedQuery('number=' +inc_num + '^short_descriptionLIKE' +code_split[i] + '^ORdescriptionLIKE' +code_split[i] + '^ORclose_notesLIKE' +code_split[i] + '^ORwork_notes_listLIKE' +code_split[i]);
//gs.info('Test' +gr.getEncodedQuery());
gr.query();
gs.info('Testconcat' +gr.getEncodedQuery());
while(gr.next())
{
  var id;
  var string = outputs.id = gr.short_description;
  var descrip = outputs.id = gr.description;
  var notes = outputs.id = gr.close_notes;
  var consolidate = string.concat(" "+descrip+ " " +notes)
  gs.info('merge' +consolidate);
  var match = code_split[i]; // word to match
  var regex = new RegExp('\\b('+match+')\\b');
  var result = (consolidate.match(regex) != null);
  if (result == true){
   gs.info("Yes!!! we got the correct incident to close");
   outputs.id=gr.sys_id;
   }
  else{
    gs.info("not working");
    gs.info('merge' +consolidate);
    outputs.id="invalid record"};
   }

}
})(inputs, outputs);

